ens), such as bacteria and viruses. .\nThe main types of immune cells are white blood cells (WCB) lymphocytes and phagocytes. When we\u2019re stressed, the immune system\u2019s ability to fight off antigens is reduced because our stress hormone, cortisol, suppresses lymphocyte production and we become more susceptible to infections. The lower your lymphocyte level, the more at risk you are for contracting viruses. \nThe best thing you can possibly do at a time like this is to remain calm and do your part to maintain health now and always:\n.\n-Follow the direction of Health Officials... these are people who have dedicated their lives and education to infection control and population health. It is their job to direct us. Trust in them. -Good health hygiene. This is something we should always be practicing and the current situation is a somber reminder of how bad we are at it. It disturbs me that we have to reiterate practices like not visiting the elderly when sick (who was doing this before?!!) or washing hands or wiping down gym equipment and children\u2019s toys. The current recommendations should just be daily practices. Always. -Proper nutrition, minimal alcohol, get enough rest, daily exercise. Again, this should just be everyday life. -Stay home if you\u2019re sick. Just stay home. And that doesn\u2019t mean just staying home from work or school. That means Costco and the malls too. My rule has always been \u201cif you\u2019re too sick for school you\u2019re too sick for activities and friends.\u201d\n-Practice preventive health care by getting regular physicals, get your blood work done right away instead of leaving that requisition in your car for 6 months, go to the dentist regularly, the optometrist... stop waiting until you are symptomatic to go and prevent symptoms instead. -Review what constitutes a reason to call 911 or go to an ER and follow your localities emergency protocols. 911 and Emergency Services are for EMERGENCIES. Period. \nThank you for coming to my (2nd) #tedtalk \ud83d\ude4b\ud83c\udffc\u200d\u2640\ufe0f"}}]},"shortcode":"B9xLRtRgWMm","edge_media_to_comment":{"count":1},"taken_at_timestamp":1584305557,"dimensions":{"height":1265,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89858536_857602368046128_7811158114243561310_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=HMs5zbRNaoIAX_Luumo\u0026oh=f79c985406986a19db4dbc0c785761b7\u0026oe=5EA23581","edge_liked_by":{"count":1},"edge_media_preview_like":{"count":1},"owner":{"id":"192133629"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.83.970.970a/s640x640/89858536_857602368046128_7811158114243561310_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=HMs5zbRNaoIAX_Luumo\u0026oh=c02111a6e43cb905c9b1c667c410ee55\u0026oe=5E9D959B","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.83.970.970a/s150x150/89858536_857602368046128_7811158114243561310_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=HMs5zbRNaoIAX_Luumo\u0026oh=a5881498c7682556d7e52d24f82b7e06\u0026oe=5E9E6E91","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.83.970.970a/s240x240/89858536_857602368046128_7811158114243561310_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=HMs5zbRNaoIAX_Luumo\u0026oh=67d359d0530d323f7c20b6ddc3690260\u0026oe=5EA271DB","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.83.970.970a/s320x320/89858536_857602368046128_7811158114243561310_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=100\u0026_nc_ohc=HMs5zbRNaoIAX_Luumo\u0026oh=194767e8ac4bc5995edbdabba932c4f9\u0026oe=5EA36061","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.83.970.970a/s480x480/89858536_
